webpackJsonp([0xf714d60be4c],{866:function(t,e){t.exports={data:{wordpressPost:{title:"Social stigma, patient knowledge and bed sharing: Most read articles in November",content:'<p>The most-read article in November was Snow <em>et al&#8217;s</em> article on what happens when patients have more knowledge than their doctors. Werb <em>et al</em>&#8216;s article on international government surveillance systems continues to be popular. Other newly-published papers in the top ten include Rajmil <em>et al</em>&#8216;s look at the impact of the economic crisis on children&#8217;s health and Browne <em>et al&#8217;s </em>study of the social stigma around type 2 diabetes.</p>\n<table width="483" border="1" cellspacing="0" cellpadding="0">\n<tbody>\n<tr>\n<td valign="top" width="50">Rank</td>\n<td valign="top" width="132">Author(s)</td>\n<td valign="top" width="301">Title</td>\n</tr>\n<tr>\n<td width="50">1</td>\n<td width="132">Snow <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/11/e003583.full" target="_blank">What happens when patients know more than their doctors? Experiences of health interactions after diabetes patient education: a qualitative patient-led study</a></td>\n</tr>\n<tr>\n<td width="50">2</td>\n<td width="132">Carpenter <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/5/e002299.full" target="_blank">Bed sharing when parents do not smoke: is there a risk of SIDS? An individual level analysis of five major case–control studies</a></td>\n</tr>\n<tr>\n<td width="50">3</td>\n<td width="132">Werb <em>et al</em></td>\n<td valign="top" width="301"><a href="http://www.bmjopen.bmj.com/content/3/9/e003077.full" target="_blank">The temporal relationship between drug supply indicators: an audit of international government surveillance systems</a></td>\n</tr>\n<tr>\n<td width="50">4</td>\n<td width="132">Ford <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/3/e002269.full" target="_blank">Current treatments in diabetic macular oedema: systematic review and meta-analysis</a></td>\n</tr>\n<tr>\n<td width="50">5</td>\n<td width="132">Doyle <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/1/e001570.full" target="_blank">A systematic review of evidence on the links between patient experience and clinical safety and effectiveness</a></td>\n</tr>\n<tr>\n<td width="50">6</td>\n<td width="132">Wakefield <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/7/e003175.full" target="_blank">Introduction effects of the Australian plain packaging policy on adult smokers: a cross-sectional study</a></td>\n</tr>\n<tr>\n<td width="50">7</td>\n<td width="132">Rajmil <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/8/e003286.abstract" target="_blank">Impact of the economic crisis on children&#8217;s health in Catalonia: a before–after approach</a></td>\n</tr>\n<tr>\n<td width="50">8</td>\n<td width="132">Browne <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/11/e003384.full" target="_blank">‘I call it the blame and shame disease’: a qualitative study about perceptions of social stigma surrounding type 2 diabetes</a></td>\n</tr>\n<tr>\n<td width="50">9</td>\n<td width="132">Nguyen <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/11/e003135.full" target="_blank">Statin treatment and risk of recurrent venous thromboembolism: a nationwide cohort study</a></td>\n</tr>\n<tr>\n<td width="50">10</td>\n<td width="132">Taylor <em>et al</em></td>\n<td valign="top" width="301"><a href="http://www.bmjopen.bmj.com/content/3/10/e003219.full" target="_blank">Prevalence and incidence rates of autism in the UK: time trend from 2004–2010 in children aged 8 years</a></td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p>Most read figures are based on pdf downloads and full text views. Abstract views are excluded.<!--TrendMD v2.4.3--></p>\n'},site:{siteMetadata:{title:"Gatsby Default Starter"}}},pathContext:{id:"5679401b-d8e8-56d8-9ed7-9b396e9334eb"}}}});
